    const { status } = await authenticateUser('/dashboard');
    if (status !== 200) navigate('/login');
    else {
      setShowPage(true);
    }
    console.log('Show page: ', showPage);
  };

  return (
    <div>
      {/* call the page */}
      {showPage && <Heading>Dashboard</Heading>}
    </div>
  );
};

